import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var AlignLeft = createReactComponent("AlignLeft", ["svg", defaultAttributes, [["line", {
  x1: "21",
  y1: "6",
  x2: "3",
  y2: "6",
  key: "1kn1du"
}], ["line", {
  x1: "15",
  y1: "12",
  x2: "3",
  y2: "12",
  key: "wvjmef"
}], ["line", {
  x1: "17",
  y1: "18",
  x2: "3",
  y2: "18",
  key: "24plut"
}]]]);
export default AlignLeft;
